import React from 'react'
import { Router, Route, Routes } from 'react-router-dom';
import Main from './Main';

function Header({listwords}) {
  return (
    <Router>
      <div>
        <nav>
          <ul>
            <li>
              <Link to="/">Home</Link>
            </li>
            <li>
              <Link to="/trainer">Home</Link>
            </li>
          </ul>
        </nav>
      </div>
    </Router>
  )
}

export default Header;
